Do you need to integrate SkyDrive file access into your Windows Phone 8 app?  Instead of starting from scratch with the Live SDK, use the SkyDrive browse task to open the current user's files as easily as you request a photo or send an email.  Just authenticate your LiveClient, setup the task, and show it:

var t = new SkyDriveBrowserTask{ LiveClient = _liveClient, t.Extensions = "xlf;xliff" };
t.Completed += SkyDrive_Completed;
t.Show();

